      SELECT ALL * FROM tab1 (FORMAT parquet) cor0 WHERE NOT + col1 + + col0 + - + col2 - - col1 NOT BETWEEN col1 * + col1 AND - 75 * + - col1 * - - col0 + - 30 + - ( + - 41 ) * + - ( + - col1 ) - + ( - col2 );
  - name: tab1

outputs:
  - name: q9564.out
    data: |
      85	5	59
